            });
        }
        let not_found = '';
        let found = TYPE_ENUM.find(function(action) {
            return action == this;
        }, type);
        if (typeof found === "undefined") {
            not_found = type;
        }

        if (not_found !== '') {
            throw new Error({
                message: "OGAPI_NOT_ALLOWED_PARAMETER",
                parameter: JSON.stringify(not_found),
                allowed: JSON.stringify(TYPE_ENUM)
            });

