'use strict';

import BaseProvision from '../BaseProvision';
import q from 'q';


/**
 * This class allow set simple values.
 */
export default class BulkBuilder extends BaseProvision {

    /**
     * @param {InternalOpenGateAPI} ogapi - required field. This is ogapi instance
     * @param {resource} resource - required field. This is the resource used for the bulk provision
     * @param {extension} extension - required field. Type of file to send
     * @param {number} [timeout] - timeout in millisecons. The request will have a specific time out if it will be exceeded then the promise throw an exception
     */
    constructor(ogapi, resource, extension, timeout) {
        super(ogapi, resource);
        this._timeout = timeout;
        this._resource = resource;
        this._extension = extension;

    }


    _composeElement() {
        return this;
    }

    _buildURL() {
        return this._resource;
    }

    /**
     *  Execute the bulk creation operation
     * @example 
     *  ogapi.newCsvBulkBuilder('orgname', 'entities', 10000).create(rawFile)
     *  ogapi.newCsvBulkBuilder('orgname', 'entities', 10000).create(new Blob(), true)
     * @param {string|Blob} rawFile - File with format string or Blob 
     * @param {boolean} [csv_response] - true if you want a response on format csv. False or null if you want a response on format json
     */
    create(rawFile, csv_response) {
        return this._executeOperation(rawFile, 'CREATE', csv_response);
    }

    /**
     *  Execute the bulk delete operation
     * @example 
     *  ogapi.newCsvBulkBuilder('orgname', 'entities', 10000).delete(rawFile)
     *  ogapi.newCsvBulkBuilder('orgname', 'entities', 10000).delete(new Blob(), true)
     * @param {string|Blob} rawFile - File with format string or Blob 
     * @param {boolean} [csv_response] - true if you want a response on format csv. False or null if you want a response on format json
     */
    delete(rawFile, csv_response) {
        return this._executeOperation(rawFile, 'DELETE', csv_response);
    }

    /**
     *  Execute the bulk delete full operation
     * @example 
     *  ogapi.newCsvBulkBuilder('orgname', 'entities', 10000).deleteAll(rawFile)
     *  ogapi.newCsvBulkBuilder('orgname', 'entities', 10000).deleteAll(new Blob(), true)
     * @param {string|Blob} rawFile - File with format string or Blob 
     * @param {boolean} [csv_response] - true if you want a response on format csv. False or null if you want a response on format json
     */
    deleteAll(rawFile, csv_response) {
        return this._executeOperation(rawFile, 'DELETE&full=true', csv_response);
    }

    /**
     *  Execute the bulk update operation
     * @example 
     *  ogapi.newCsvBulkBuilder('orgname', 'entities', 10000).update(rawFile)
     *  ogapi.newCsvBulkBuilder('orgname', 'entities', 10000).update(new Blob(), true)
     * @param {string|Blob} rawFile - File with format string or Blob 
     * @param {boolean} [csv_response] - true if you want a response on format csv. False or null if you want a response on format json
     */
    update(rawFile, csv_response) {
        return this._executeOperation(rawFile, 'UPDATE', csv_response);
    }

    _executeOperation(rawFile, action, csv_response) {
        let form;
        if (typeof rawFile !== 'string') {
            form = {};
            if (rawFile) {
                let bulkFile = new Blob([rawFile]);
                form.bulkFile = bulkFile;
            }
        } else {
            form = {};

            if (rawFile) {
                form.bulkFile = rawFile;
            }
        }
        let defer = q.defer();
        form.ext = this._extension;

        var petitionUrl = this._buildURL();
        //url, formData, events, timeout, headers, parameters
        if (csv_response)
            this._setExtraHeaders({
                'accept': 'text/plain'
            });
        this._setUrlParameters({
            action: action
        });
        this._ogapi.Napi.post_multipart(petitionUrl, form, {}, this._timeout, this._getExtraHeaders(), this._getUrlParameters())
            .then((response) => {
                let statusCode = response.statusCode;
                if (statusCode === 200 || statusCode === 201) {
                    if (csv_response && !response.location) {
                        //Se hace esto para que la respuesta sea igual que al searching con resultado en csv
                        let resultQuery = response;
                        let statusCode = response.statusCode;
                        defer.resolve({
                            data: resultQuery,
                            statusCode: statusCode
                        });
                    } else
                        defer.resolve(response);
                } else if (statusCode === 204) {
                    defer.resolve(response);

                } else {
                    defer.reject({
                        errors: response.data.errors,
                        statusCode: response.statusCode
                    });
                }
            })
            .catch((error) => {
                defer.reject(error);
            });
        return defer.promise;
    }
}

'use strict';

import SimpleBuilder from './SimpleBuilder';

/**
 * This class extends SimpleBuilder to allow set complex values. What is a complex value? It is simple, It is a value 
 * that need a communications module identifier to allow set into the box.
 */
export default class ComplexBuilder extends SimpleBuilder {


    /**
     * @param {!InternalOpenGateAPI} ogapi - this is ogapi instance
     * @param {!string} resource - this is the resource url where can be create/delete/update/read the entity
     * @param {!array} [allowedDatastreams] - Allowed datastreams to add into the new entity
     * @param {!array} [definedSchemas] - Jsonschema about all OpenGate specific types
     * @param {!Validator} [jsonSchemaValidator] - Json schema validator tool
     */
    constructor(ogapi, resource, allowedDatastreams, definedSchemas, jsonSchemaValidator, timeout) {
        super(ogapi, resource, allowedDatastreams, definedSchemas, jsonSchemaValidator, timeout);
    }

    initFromFlattened(_flattenedEntityData) {
        let _this = this;
        if (_flattenedEntityData && Object.keys(_flattenedEntityData).length > 0) {
            Object.keys(_flattenedEntityData).forEach(function(_id) {
                if (_id.toLowerCase().startsWith("provision")) {
                    var _content = _flattenedEntityData[_id];

                    if (_content.forEach) {
                        _content.forEach(function(_relation) {
                            if (_relation._index.value && _relation._value && _relation._value._current) {
                                _this.withComplex(_id, _relation._index.value._current.value, _relation._value._current.value);
                            }
                        });
                    } else {
                        _this.with(_id, _content._value._current.value);
                    }
                }
            });
        }
    }


    _initFormJson(_jsonEntityData, _path, complex) {
        let _this = this;
        if (_jsonEntityData) {
            var keys = Object.keys(_jsonEntityData);
            keys.forEach(function(key) {
                var obj = _jsonEntityData[key];
                var _current = obj._current;
                var path = _path ? (_path + '.' + key) : key;
                if (_current) {
                    var value = _current.value;
                    if (complex) {
                        _this.withComplex(path, complex, value);
                    } else {
                        _this.with(path, value);
                    }
                } else {
                    if (Array.isArray(obj)) {
                        obj.forEach(function(cm) {
                            _this._initFromJson(cm, path + '[]', cm.identifier._current.value);
                        });
                    } else
                        _this._initFromJson(obj, path, complex);
                }
            });
        }
    }

    initFromJson(_jsonEntityData) {
        let _this = this;
        var provision = {};
        if (_jsonEntityData && (provision = _jsonEntityData.provision)) {
            _this._initFromJson(provision, 'provision');
        }
    }

    /**
     * Set a complex value to entity
     * @param {!string} _id - Datastream identifier
     * @param {!string} idCommunicationModules - Communications module identifier
     * @param {object} val - Value to set.
     */
    withComplex(_id, idCommunicationModules, val) {
        if (!idCommunicationModules) {
            console.warn('Communication module identifier not defined. This value wil be ignored');
            return this;
        }
        if (this.getAllowedDatastreams().filter(function(ds) {
                return ds.identifier === _id;
            }).length !== 1) {
            console.warn('Datastream not found or operations can not be performed on it. This value will be ignored. Datastream Name: ' + _id);
            return this;
        }
        if (!this._entity[_id])
            this._entity[_id] = [];

        let _found = false;

        for (let _idx = 0; _idx < this._entity[_id].length; _idx++) {
            let _rel = this._entity[_id][_idx];
            if (_rel._index && _rel._index.value && _rel._index.value === idCommunicationModules) {
                this._entity[_id][_idx] = {
                    '_index': {
                        'value': idCommunicationModules
                    },
                    '_value': {
                        '_current': {
                            'value': val
                        }
                    }
                };

                _found = true;
            }
        }

        if (!_found) {
            this._entity[_id].push({
                '_index': {
                    'value': idCommunicationModules
                },
                '_value': {
                    '_current': {
                        'value': val
                    }
                }
            });
        }

        return this;
    }
}

