    delete(defered, percentage) {
        let _this = this;
        return this._ogapi.Napi.delete(this._urlWithKey())
            .then((res) => {
                defered.notify({
                    entity: _this._key,
                    message: 'OGAPI_ENTITY_DELETED',
                    type: 'warning',
                    percentage: percentage
                });
            });
    }
}

class WrapperBuilder {
    constructor(ogapi, obj, url, key) {
        this._obj = obj;
        this._url = url;
        this._ogapi = ogapi;
        this._key = key;
        this._created = false;
    }

    _urlWithKey() {
        return this._url + '/' + this._key;
    }

    _checkExists() {
        return this._ogapi.Napi.get(this._urlWithKey()).then(function(response) {
            return response.statusCode === HttpStatus.OK;
        }).catch((err) => {
            console.warn(err);
            return false;
        });
    }


    execute(defered, percentage) {
        let defer = q.defer();
        let _this = this;
        this._checkExists().then((exists) => {
            if (!exists) {
                create(defered, defer, percentage);
            } else {
                defer.resolve({
                    message: 'OGAPI_ENTITY_ALREADY_CREATED',
                    entity: _this._key
                });
            }
        }).catch((exists) => {
            if (!exists) {
                create(defered, defer, percentage);
            } else {
                defer.resolve({
                    message: 'OGAPI_ENTITY_ALREADY_CREATED',
                    entity: _this._key
                });
            }
        });
        return defer.promise;

        function create(defered, defer, percentage) {
            _this._ogapi.Napi.post(_this._url, _this._obj, null, null, {
                    flattened: true
                })
                .then((res) => {
                    _this._created = true;
                    defered.notify({
                        entity: _this._key,
                        message: 'OGAPI_ENTITY_CREATED',
                        type: 'success',
                        percentage: percentage
                    });
                    defer.resolve({
                        message: 'OGAPI_ENTITY_CREATED',
                        entity: _this._key
                    });
                }).catch((err) => {
                    console.error(err);
                    defered.notify({
                        entity: _this._key,
                        message: 'OGAPI_ENTITY_CREATED',
                        type: 'warning',
                        percentage: percentage
                    });
                    defer.reject({
                        entity: _this._key,
                        message: 'OGAPI_SOMETHING_WRONG_CREATING',
                    });
                });
        }
    }

    delete(defered, percentage) {
        let _this = this;
        if (this._created) {
            return this._ogapi.Napi.delete(this._urlWithKey())
                .then((res) => {
                    defered.notify({
                        entity: _this._key,
                        message: 'OGAPI_ENTITY_DELETED',
                        type: 'warning',
                        percentage: percentage
                    });
                });
        }
        return Q.fcall(() => {
            return;
        });
    }

}

