            var resultContent = {};
            resultContent[_this._contentType] = finalContent;
            defered.resolve({
                data: resultContent,
                statusCode: 200
            });
        } else {
            //Existe el catalogo pero no hay datos
            defered.resolve({
                data: {},
                statusCode: 204
            });
        }

        return promise;
    }

    _content(contentType) {
        return {
            'ticketSeverity': [
                'CRITICAL', 'URGENT', 'WARNING', 'NORMAL'
