'use strict';

import PreFilteredSearchBuilder from './PreFilteredSearchBuilder';
import FieldFinder from '../../util/searchingFields/FieldFinder';
import AssetSearch from '../AssetSearch';

const BASE_URL = '/entities';
/**
 * Defined a search over Assets	
 * @example ogapi.assetsSearchBuilder()
 */
export default class AssetsSearchBuilder extends PreFilteredSearchBuilder {
    /**
     *	@param {!InternalOpenGateAPI} parent - Instance of our InternalOpenGateAPI
     */
    constructor(parent) {
        super(parent, {}, new FieldFinder(parent, BASE_URL));
        this._url = BASE_URL;
    }

    /**
     * The response will only have a summary information 
     * @example
     *	ogapi.assetsSearchBuilder().summary() 
     * @return {AssetsSearchBuilder} 
     */
    summary() {
        this._url = this._url + '/summary';

        return this;
    }

    _buildFilter() {
        let finalFilter = {
            "and": [{
                "exists": {
                    "provision.asset.identifier": true
                }
            }]
        };

        if (this._builderParams.filter && Object.keys(this._builderParams.filter).length > 0) {
            let filter = this._builderParams.filter;
            if (typeof filter._filterTemplate !== "undefined") {
                //return filter._filterTemplate;
                finalFilter.and.push(filter._filterTemplate.filter);
            } else {
                finalFilter.and.push(filter);
            }
        }

        return {
            filter: finalFilter
        };
    }

    /**
     * The search request will have this group by 
     * @example
     * @param {!(object)} group 
     * @return {AssetsSearchBuilder} 
     */
    group(group) {
        this._builderParams.group = (group || {});
        return this;
    }

    /**
     * Build a instance of Search 
     *
     * @example
     *  ogapi.assetsSearchBuilder().onProvisioned().build()
     * @throws {SearchBuilderError} Throw error on url build
     * @return {Search} 
     */
    build() {
        return new AssetSearch(this._parent,
            this._buildUrl(),
            this._buildFilter(),
            this._buildLimit(),
            this._buildSort(),
            this._buildGroup(),
            this._buildSelect(),
            this._builderParams.timeout, this._urlParams);
    }

    /**
     * The search request will have this filter 
     * @example
     *  ogapi.assetsSearchBuilder().select(
     *      ogapi.newSelectBuilder().add(SE.element("provision.device.identifier", ["value"], "id"), SE.add("device.temperature.value", ["value"]))
     *  ) // Setting SelectBuilder
     *  ogapi.assetsSearchBuilder().select({ "elements": [{"name": "provision.device.identifier",
     *		"fields": [{"field": "value","alias": "identifier"}]},
     *      {"name": "device.temperature.value","fields": [{"field": "value","alias": "identifier"}]}]
     *   }) //Custom select
     * @param {!(SelectBuilder|object)} select
     * @return {AssetsSearchBuilder} 
     */
    select(select) {
        this._builderParams.select = (select || undefined);
        return this;
    }
}

'use strict';

import q from 'q';
import merge from 'merge';
import jp from 'jsonpath';


/** 
 * This is a abstract class, it must be extended to another class that defined the specific search.
 * This class is responsible to manage execute request to OpenGate North API
 */
export default class BasicTypesSearchBuilder {
    /**
     * @param {!InternalOpenGateAPI} ogapi - this is ogapi instance
     * @param {!number} [timeout] - timeout on request
     */
    constructor(ogapi, timeout) {
        this._ogapi = ogapi;
        this._resource = 'resources/schemaTypes/og_basic_types';
        this._headers = undefined;
        this._og_basic_types = {};
        this.publicParameters = false;
        this._urlParameters = undefined;
    }
    _getExtraHeaders() {
        return this._headers;
    }

    _setExtraHeaders(headers) {
        if (this._headers) {
            var keys = Object.keys(headers);
            for (var i = 0; i < keys.length; i++) {
                var key = keys[i];
                this._headers[key] = headers[key];
            }
        } else {
            this._headers = headers;
        }
    }

    _getUrlParameters() {
        return this._urlParameters;
    }

    _setUrlParameters(parameters) {
        if (this.parameters) {
            var keys = Object.keys(parameters);
            for (var i = 0; i < keys.length; i++) {
                var key = keys[i];
                this._urlParameters[key] = parameters[key];
            }
        } else {
            this._urlParameters = parameters;
        }
    }

    /**
     * This invoke a request to OpenGate North API and the callback is managed by promises
     * @return {Promise}
     * @property {function (result:object, statusCode:number)} then - When request it is OK
     * @property {function (error:string)} catch - When request it is NOK
     */
    execute() {
        var defered = q.defer();
        var promise = defered.promise;
        this._setExtraHeaders({
            'Accept': 'application/json'
        });
        this._ogapi.Napi
            .get(this._resource, this._timeout, this._getExtraHeaders(), this._getUrlParameters())
            .then((response) => {
                var resultQuery = response.body;
                let statusCode = response.statusCode;
                this._og_basic_types = resultQuery;

                var nodes = jp.apply(this._og_basic_types, "$..['$ref']",
                    function (value, path) {
                        let newPath = '$..' + value.replace('#/definitions/', '');
                        var newValue = jp.query(resultQuery, newPath);
                        return newValue[0];
                    });
                nodes.forEach(element => {
                    var pathExpression = jp.stringify(element.path);
                    jp.value(resultQuery, pathExpression, element.value);
                });
                if (this.path) {
                    let path = this.path.includes('$') ? this.path : '$..' + this.path;
                    let jsonSchemaValue = jp.query(resultQuery, path)[0] || {
                        msg: 'not Found'
                    };
                    defered.resolve({
                        data: jsonSchemaValue,
                        statusCode: statusCode
                    });
                } else {
                    if (this.publicParameters) {
                        for (let x in resultQuery.definitions) {
                            if (!resultQuery.definitions[x].public || resultQuery.definitions[x].public === false) {
                                delete resultQuery.definitions[x];
                            }
                        }
                    }
                    defered.resolve({
                        data: resultQuery,
                        statusCode: statusCode
                    });
                }
            })
            .catch((error) => {
                defered.reject(error);
            });
        return promise;
    }

    /**
     * Sets path to search
     *
     * @description
     * @example
     *  ogapi.basicTypesSearchBuilder().withPath('string').build()
     * @param {!string} path - jsonSchemaPath
     * @return {BasicTypesSearchBuilder}
     */
    withPath(path) {
        this.path = path;
